INSERT INTO `faqs` (`id`, `question`, `slug`, `answer`, `total_read`, `created_at`, `updated_at`, `deleted_at`, `created_by`, `updated_by`, `deleted_by`) VALUES
(1, 'O que é o Bolsa livre?', 'o-que-e-o-bolsa-livre', 'O BolsaLivre.com é um site que oferece para toda e qualquer pessoa, bolsas de estudos parciais, disponibilizadas por instituições particulares parceiras.', 0, '2018-08-16 04:44:47', '2018-08-16 04:44:47', NULL, NULL, NULL, NULL),
(2, 'O bolsa livre é mesmo para todos?', 'o-bolsa-livre-e-mesmo-para-todos', 'Sim. As bolsas são disponibilizadas para todas pessoas, que querem estudar pagando menos, que são antenadas em oportunidades e descontos, com mensalidades que cabem no bolso.', 0, '2018-08-16 04:44:47', '2018-08-16 04:44:47', NULL, NULL, NULL, NULL),
(3, 'Como emitir o comprovante de pré-matrícula?', 'como-emitir-o-comprovante-de-pre-matricula', 'Após escolher a sua bolsa, clique em QUERO ESTA BOLSA, inscreva-se etapa seguinte - dados que vão constar no seu Comprovante de Pré-Matricula para conferência na instituição de ensino, clique em FINALIZAR COMPRA, efetue o pagamento pelo PagSeguro - através de boleto ou cartão de crédito - receba a confirmação por e-mail e a liberação do Comprovante de Pré Matrícula por e-mail e na sua conta no site.', 0, '2018-08-16 04:44:47', '2018-08-16 04:44:47', NULL, NULL, NULL, NULL),
(4, 'Como saber que a bolsa está liberada para efetivar a matrícula?', 'como-saber-que-a-bolsa-esta-liberada-para-efetivar-a-matricula', 'Logo que o Comprovante de Pré-Matricula estiver disponível. A liberação do documento acontece após a compensação pagamento da taxa de inscrição, que é realizada aqui mesmo no site, via cartão de crédito ou boleto bancário. Ao contrario de outros projetos, o pagamento realizado é de uma taxa única, referente e equivalente a primeira mensalidade da instituição já com a bolsa, e garante a bolsa por toda etapa de formação ou por todo curso escolhido.', 0, '2018-08-16 04:44:47', '2018-08-16 04:44:47', NULL, NULL, NULL, NULL),
(5, 'O Bolsa Livre Programa Educaional é seguro?', 'o-bolsa-livre-programa-educaional-e-seguro', 'Sim! Contribuímos com a educação no Rio de Janeiro desde 2011 em projetos similares através de sites, em projeto social de alfabetização de jovens que não tinham mais perspectivas.', 0, '2018-08-16 04:44:47', '2018-08-16 04:44:47', NULL, NULL, NULL, NULL),
(6, 'O percentual da bolsa é válido durante toda etapa de formação?', 'o-percentual-da-bolsa-e-valido-durante-toda-etapa-de-formacao', 'Sim! Naturalmente podem ocorrer reajustes, mas o percentual liberado no comprovante de pré-matricula é valido até a conclusão do curso ou etapa de formação.', 0, '2018-08-16 04:44:47', '2018-08-16 04:44:47', NULL, NULL, NULL, NULL),
(7, 'Caso aconteça algum problema com a matrícula ou com a bolsa?', 'caso-aconteca-algum-problema-com-a-matrícula-ou-com-a-bolsa', 'Vamos conferir o ocorrido, e prestar esclarecimentos imediatamente. Se a matrícula não puder ser efetivada vale a nossa política “bolsa garantida ou seu dinheiro de volta”, realizamos o estorno do valor integral pago ao site Bolsa Livre.', 0, '2018-08-16 04:44:47', '2018-08-16 04:44:47', NULL, NULL, NULL, NULL);
