(37, 'Futuro VIP', 'futuro-vip', '184750201809045b8ed35698070.png', '222.365.897/0001-98', 'Ladeira da Freguesia, 196', '22710-045', '2252-9966', NULL, 85, 'Estrutura Pedagógica\r\nO desenvolvimento do aluno como um todo está diretamente ligado às experiências vividas. Pensando assim, nossa escola proporciona experiências que desenvolvam a sua socialização e aprendizagem com criatividade, segurança, respeito mútuo, de forma prazerosa e atribuindo significado ao conteúdo.\r\nPriorizando o trabalho com projetos, definindo, construindo e avaliando coletivamente as necessidades práticas e concretas, proporcionamos o desenvolvimento de aptidões, estimulando a curiosidade pelo aprendizado, o raciocínio lógico, a linguagem, o espírito científico, o senso crítico e o exercício consciente da cidadania.\r\n  \r\nEspaço Físico\r\nNossas salas de aula são amplas e arejadas, mobiliadas e decoradas adequadamente para cada faixa etária. \r\nPara a Educação Infantil temos pátios especialmente preparados, com brinquedos criativos e muito espaço onde a natureza pode ser apreciada. A Educação Infantil conta também com a Sala de Multi-meios, um espaço preparado para estimular a criança a brincar, possibilitando seu acesso a grande variedade de atividades, dentro de um ambiente lúdico, onde tudo convida a explorar, sentir e experimentar.\r\n \r\nEquipe De Trabalho\r\nA equipe de apoio pedagógico (Coordenadora e Psicopedagoga), juntamente com os professores, mantém-se atualizada, participando de cursos, palestras, reuniões, congressos e leituras, buscando alto nível de ensino para a escola. Trabalhamos com professoras regentes e auxiliares com formação pedagógica. Contamos, também, com professores especializados nas áreas de Artes, Música, Inglês e Educação Física, proporcionando às crianças aulas semanais.', 1, '2018-09-04 21:47:50', '2018-09-17 20:13:59', '2018-09-17 20:13:59', 0, NULL, NULL, NULL, 17, 'Ative a bolsa de estudos na secretaria, levando o Comprovante de Pré-Matricula, ele tem validade de 7 dias corridos. Após a emissão, podendo ser renovado pelo Bolsa Livre, com solicitação antecipada ao vencimento, se autorizado pela Instituição. A não efetivação da matricula é entendida como falta de interesse na bolsa, podendo ser liberada para outro candidato interessado.\r\nCaso precise desistir da vaga, basta entrar em contato com o Bolsa Livre, que realizamos o estorno do valor integral pago ao site. Vamos confirmar alguns dados, histórico de transações, validade do Comprovante de Pré Matrícula, dar baixa no sistema e realizar o estorno em até 5 dias.\r\nCondições\r\nSelecionar a bolsa pretendida\r\nSe inscrever no site ou pela central de atendimento\r\nEfetuar o pagamento da taxa de inscrição – equivalente a primeira mensalidade da escola – aqui no site do bolsa livre. Único investimento realizado no site bolsalivre.com\r\nImprimir o Comprovante de Pré-Matricula que garante a bolsa de estudos e apresentar na secretaria para ativar a bolsa.\r\nA partir da segunda mensalidade, os pagamentos são efetuados na instituição escolhida diretamente\r\nA bolsa de estudos é válida exclusivamente para as mensalidades\r\nA bolsa de estudos é válida para alunos ingressantes na instituição pretendida\r\nEntregar a documentação requerida pela Instituição\r\nEstar de acordo com o regimento interno da Instituição\r\nNão é valido para despesas de uniforme, documentos, segunda chamada, cantina, transporte e qualquer extra\r\nPrestar vestibular caso de graduação – em caso de reprovação devolvemos integralmente o valor pago ao site bolsa livre.\r\nAssinar o contrato de prestação de serviço da Instituição de ensino escolhida\r\nA bolsa é valida vaga selecionados no site no ato da inscrição.\r\nValidade da bolsa\r\nNo ensino básico é valida por toda etapa de formação\r\nEducação infantil:\r\nBerçário\r\nMaternal I\r\nMaternal I\r\nPré I\r\nPré II\r\nFundamental I:\r\n1º ano\r\n2º ano\r\n3º ano\r\n4º ano\r\n5º ano\r\nFundamental II:\r\n6º ano\r\n7º ano\r\n8º ano\r\n9º ano\r\nEnsino médio:\r\n1ª série\r\n2ª série\r\n3ª série', 'Nossa pedagogia é baseada nos fundamentos epistemiológicos e didático-pedagógicos.', 'Freguesia', '["81","86","87"]'),
