(45, 'CAPBio Curso Técnico', 'capbio-curso-tecnico', '222322201809205ba41ddae68ff.png', '97.537.627/0001-18', 'Avenida Santa Cruz, 1678', '21710-232', '021 3563-6707', NULL, 96, '- Curso Técnico Análises Clínicas: para atuar em laboratórios, hospitais, postos de saúde; indústrias farmacêuticas, cosméticos, alimentícia; em instituições de ensino. CARGA HORÁRIA: 1440 horas.\r\n\r\n\r\n- Curso Técnico em Citopatologia: para atuar na realização do exame preventivo do câncer do colo uterino ou teste de Papanicolau em laboratórios de Anatomia Patológica e Citopatologia, na perspectiva da promoção da saúde, prevenção de agravos e tratamento de doenças. CARGA HORÁRIA: 1760 horas.', 1, '2018-09-21 01:23:22', '2018-09-30 19:20:55', NULL, 0, NULL, NULL, NULL, 20, 'Realizar a inscrição no site Bolsa Livre.\r\nEfetuar o pagamento da taxa de inscrição ao site.\r\nImprimir o CPM - Comprovante de Pré Matrícula liberado pelo site após compensação.\r\nEntregar o CPM na secretaria da instituição selecionada dentro do prazo de 7 dias.\r\nO benefício é válido exclusivamente para as mensalidades.\r\nO benefício é valido exclusivamente para novos alunos.\r\nNecessário ler o regulamento do Bolsa Livre e estar de acordo para concluir a inscrição.\r\nNecessário assinar o contrato de prestação de serviço educacional na instituição de ensino.\r\nCancelamento do benefício quando houver inadimplência, reprovação do aluno pedagógica ou disciplinar.\r\nPode implicar na perda da bolsa de estudos: transferência de unidade, transferência de turno, abandono escolar.', 'Os fundadores motivados em suprir a carência na região, fundaram o curso, formando alunos à exercer adequadamente seu ofício.', 'Realengo', '["52","98","101"]'),
(46, 'Centro Educacional Ângelo Dos Santos', 'centro-educacional-angelo-dos-santos', '235601201809205ba43391ebd4b.jpeg', '00.940.451/0001-09', 'Rua Júlio Diniz, 65', '23073-750', '(021) 3403-6622', NULL, 101, 'A escola desenvolve projetos culturais com os alunos, elucidando-os através de eventos, o imaginário e o cognitivo de cada criança.', 0, '2018-09-21 02:56:01', '2018-09-21 02:56:01', NULL, 0, NULL, NULL, NULL, 1, 'Realizar a inscrição no site Bolsa Livre.\r\nEfetuar o pagamento da taxa de inscrição ao site.\r\nImprimir o CPM - Comprovante de Pré Matrícula liberado pelo site após compensação.\r\nEntregar o CPM na secretaria da instituição selecionada dentro do prazo de 7 dias.\r\nO benefício é válido exclusivamente para as mensalidades.\r\nO benefício é valido exclusivamente para novos alunos.\r\nNecessário ler o regulamento do Bolsa Livre e estar de acordo para concluir a inscrição.\r\nNecessário assinar o contrato de prestação de serviço educacional na instituição de ensino.\r\nCancelamento do benefício quando houver inadimplência, reprovação do aluno pedagógica ou disciplinar.\r\nPode implicar na perda da bolsa de estudos: transferência de unidade, transferência de turno, abandono escolar.', 'Escola com metodologia tradicional.', 'Ângelo Dos Santos', '["104","105"]'),
(47, 'Educandário Arthur Hingel', 'educandario-arthur-hingel', '013213201809215ba44a1d27c3c.jpeg', '24.170.357/0001-86', 'Rua Cerro Largo, 33', '23070-210', '(021) 2412-1659', NULL, 101, 'Aqui os alunos interagem entre si, com o professor e aprendem com livros altamente formatados para o aprendizado definitivo. Os diretores prezam pela cultura em seus diversos quesitos: 3 idiomas (inglês, alemão, espanhol), tecnologia (informática, robótica, aulas interativas), formação intelectual (imersão a arte).', 1, '2018-09-21 04:32:13', '2018-09-21 04:32:13', NULL, 0, NULL, NULL, NULL, 24, 'Realizar a inscrição no site Bolsa Livre.\r\nEfetuar o pagamento da taxa de inscrição ao site.\r\nImprimir o CPM - Comprovante de Pré Matrícula liberado pelo site após compensação.\r\nEntregar o CPM na secretaria da instituição selecionada dentro do prazo de 7 dias.\r\nO benefício é válido exclusivamente para as mensalidades.\r\nO benefício é valido exclusivamente para novos alunos.\r\nNecessário ler o regulamento do Bolsa Livre e estar de acordo para concluir a inscrição.\r\nNecessário assinar o contrato de prestação de serviço educacional na instituição de ensino.\r\nCancelamento do benefício quando houver inadimplência, reprovação do aluno pedagógica ou disciplinar.\r\nPode implicar na perda da bolsa de estudos: transferência de unidade, transferência de turno, abandono escolar.', 'A escola educa seus alunos pelo método tradicional, extremamente séria e organizada. Formando cidadãos completos, pedagogicamente, psicologicamente e socialmente.', 'Campo Grande', '["102","104","105"]'),
(48, 'Colégio Dom Motta', 'colegio-dom-motta', '123420201809215ba4e54c6dae6.png', '27.796.465/0001-57', 'Rua Teeran, 281', '21875-090', '(021) 2401-6476', NULL, 97, 'É primordial observar para avaliar. O evolução disciplinar e cognitiva. Os professores utilizam fichas individuais de acompanhamento e observação dos alunos,  preenchidos condizentes com os conteúdos conceituais, atitudinais e procedimentais desenvolvidos.', 1, '2018-09-21 15:34:20', '2018-09-21 17:10:45', NULL, 0, NULL, NULL, NULL, 25, 'Realizar a inscrição no site Bolsa Livre.\r\nEfetuar o pagamento da taxa de inscrição ao site.\r\nImprimir o CPM - Comprovante de Pré Matrícula liberado pelo site após compensação.\r\nEntregar o CPM na secretaria da instituição selecionada dentro do prazo de 7 dias.\r\nO benefício é válido exclusivamente para as mensalidades.\r\nO benefício é valido exclusivamente para novos alunos.\r\nNecessário ler o regulamento do Bolsa Livre e estar de acordo para concluir a inscrição.\r\nNecessário assinar o contrato de prestação de serviço educacional na instituição de ensino.\r\nCancelamento do benefício quando houver inadimplência, reprovação do aluno pedagógica ou disciplinar.\r\nPode implicar na perda da bolsa de estudos: transferência de unidade, transferência de turno, abandono escolar.', 'Aqui o foco é o aluno, educando o conhecimento sob educação tradicional. Seja qual for o método, o mais importante é o resultado alcançado pelo aluno. Valores, ética, respeito, honestidade, responsabilidade social e ambiental não são deixados de lado no Dom Motta.', 'Padre Miguel', '["96","98"]'),
(49, 'Colégio LLesser', 'colegio-llesser', '212853201810235bcf9295a6021.png', '02.395.430/0001-85', 'Rua Soldado Damásio Gomes, 75', '22780-610', '(021) 2441-4812', NULL, 84, 'O desenvolvimento educativo do LLesser é democrático e transformador. Proposta pedagógica baseada na formação do aluno, com práticas responsáveis socialmente, levando o aprendizado por diversos meios, atraindo atenção e o interesse pelos estudos: Movimento, Artes Visuais, Música, Tecnologia, Linguagem oral e escrita, Natureza e Sociedade e Matemática. Além do conforto e segurança promovidos pelo colégio.', 1, '2018-09-22 19:58:40', '2018-10-24 00:28:53', NULL, 0, NULL, NULL, NULL, 31, 'Realizar a inscrição no site Bolsa Livre.\r\nEfetuar o pagamento da taxa de inscrição ao site.\r\nImprimir o CPM - Comprovante de Pré Matrícula liberado pelo site após compensação.\r\nEntregar o CPM na secretaria da instituição selecionada dentro do prazo de 7 dias.\r\nO benefício é válido exclusivamente para as mensalidades.\r\nO benefício é valido exclusivamente para novos alunos.\r\nNecessário ler o regulamento do Bolsa Livre e estar de acordo para concluir a inscrição.\r\nNecessário assinar o contrato de prestação de serviço educacional na instituição de ensino.\r\nCancelamento da bolsa ocorre quando houver inadimplência, reprovação do aluno pedagógica ou disciplinar.\r\nPode implicar na perda da bolsa de estudos: transferência de unidade, transferência de turno, abandono escolar.', 'UNID Sd. Damásio. História do Colégio LLesser iniciou em 1988, movido pelos ideais de uma jovem, que realizada como mãe, professora e como cidadã. São 2 unidades, com educação do Berçário ao Ensino Médio (médio voltado para o vestibular).', 'Curicica I', '["80","131","134"]'),
(50, 'Colégio LLesser', 'colegio-llesser-1', NULL, '02.395.430/0002-66', 'Rua da Reverência, 260', '22780-580', '(021) 2424-9267', NULL, 84, 'O desenvolvimento educativo do LLesser é democrático e transformador. Proposta pedagógica baseada na formação do aluno, com práticas responsáveis socialmente, levando o aprendizado por diversos meios, atraindo atenção e o interesse pelos estudos: Movimento, Artes Visuais, Música, Tecnologia, Linguagem oral e escrita, Natureza e Sociedade e Matemática. Além do conforto e segurança promovidos pelo colégio.', 0, '2018-09-22 20:02:06', '2018-10-11 21:29:53', NULL, 0, NULL, NULL, NULL, 31, 'Realizar a inscrição no site Bolsa Livre.\r\nEfetuar o pagamento da taxa de inscrição ao site.\r\nImprimir o CPM - Comprovante de Pré Matrícula liberado pelo site após compensação.\r\nEntregar o CPM na secretaria da instituição selecionada dentro do prazo de 7 dias.\r\nO benefício é válido exclusivamente para as mensalidades.\r\nO benefício é valido exclusivamente para novos alunos.\r\nNecessário ler o regulamento do Bolsa Livre e estar de acordo para concluir a inscrição.\r\nNecessário assinar o contrato de prestação de serviço educacional na instituição de ensino.\r\nCancelamento da bolsa ocorre quando houver inadimplência, reprovação do aluno pedagógica ou disciplinar.\r\nPode implicar na perda da bolsa de estudos: transferência de unidade, transferência de turno, abandono escolar.', 'UNID Reverência. História do Colégio LLesser iniciou em 1988, movido pelos ideais de uma jovem, que hoje é realizada como mãe, professora e como cidadã. São 2 unidades, com educação do Berçário ao Ensino Médio (médio voltado para o vestibular).', 'Curicica II', '["80","131","134"]'),
(51, 'Jardim Escola Livrinho Dourado', 'jardim-escola-livrinho-dourado', NULL, '04422687/0001-04', 'Rua Zopiro Goulart, 312', '21833-210', '(021) 3469-6621', NULL, 160, 'Educação Infantil a primeira etapa na formação do ensino básico, fase importante para o desenvolvimento da criança. Psicológica e socialmente.\r\nAqui seu filho tem uma estrutura adequada e todo carinho que ele precisa para os momentos de ausência dos pais. Uma escola acolhedora, de diretora e tias amáveis. Escola regulamentada pela secretaria de educação .', 0, '2018-09-22 20:22:00', '2018-09-22 20:22:00', NULL, 0, NULL, NULL, NULL, 30, 'Realizar a inscrição no site Bolsa Livre.\r\nEfetuar o pagamento da taxa de inscrição ao site.\r\nImprimir o CPM - Comprovante de Pré Matrícula liberado pelo site após compensação.\r\nEntregar o CPM na secretaria da instituição selecionada dentro do prazo de 7 dias.\r\nO benefício é válido exclusivamente para as mensalidades.\r\nO benefício é valido exclusivamente para novos alunos.\r\nNecessário ler o regulamento do Bolsa Livre e estar de acordo para concluir a inscrição.\r\nNecessário assinar o contrato de prestação de serviço educacional na instituição de ensino.\r\nCancelamento da bolsa ocorre quando houver inadimplência, reprovação do aluno pedagógica ou disciplinar.\r\nPode implicar na perda da bolsa de estudos: transferência de unidade, transferência de turno, abandono escolar.', 'O Livrinho Dourado é considerado a extensão da casa de cada criança.', 'Jabour', '["98","99","100"]'),
(52, 'Colégio Rio São Paulo', 'colegio-rio-sao-paulo', NULL, '40.387.391/0001-63', 'Rua Felix Bernardelli, 40', '23078-030', '(021) 4107-6293', NULL, 1, 'Aqui além das disciplinas obrigatórias, encontra-se: aulas de inglês desde o Pré I, aulas de ballet, e projetos em educação ambiental, culinária, literários e muito mais. Para o conforto dos alunos e tranquilidade dos pais, o colégio é equipado com ar condicionado e seguro escolar.', 0, '2018-09-22 23:06:01', '2018-09-22 23:06:01', NULL, 0, NULL, NULL, NULL, 29, 'Realizar a inscrição no site Bolsa Livre.\r\nEfetuar o pagamento da taxa de inscrição ao site.\r\nImprimir o CPM - Comprovante de Pré Matrícula liberado pelo site após compensação.\r\nEntregar o CPM na secretaria da instituição selecionada dentro do prazo de 7 dias.\r\nO benefício é válido exclusivamente para as mensalidades.\r\nO benefício é valido exclusivamente para novos alunos.\r\nNecessário ler o regulamento do Bolsa Livre e estar de acordo para concluir a inscrição.\r\nNecessário assinar o contrato de prestação de serviço educacional na instituição de ensino.\r\nCancelamento da bolsa ocorre quando houver inadimplência, reprovação do aluno pedagógica ou disciplinar.\r\nPode implicar na perda da bolsa de estudos: transferência de unidade, transferência de turno, abandono escolar.', 'O Colégio Rio São Paulo educa construindo valores! Pois acreditam que a educação transforma. São diversos projetos desenvolvidos pelo colégio que agregam ao aprendizado do aluno. Reforço escolar, salas climatizadas, ballet, sala multimídia, sistema de câmeras.', 'Tingui', '["104","105"]'),
(53, 'Colégio Futuro VIP', 'colegio-futuro-vip', NULL, '33.547.035/0001-20', 'Ladeira da Freguesia, 196', '22760-090', '(021) 2447-4865', NULL, 85, 'Da Educação Infantil ao Ensino Médio. Em todas as etapas de formação planos de ensino são definidos para evolução do aluno, como: monitorias (tira dúvidas), acompanhamento individualizado, preparatórios (Pedro II, Militares, ENEM), eventos culturais internos (expandindo-o cultural e socialmente), jogos inter-classe (competições entre unidades),  passeios pedagógicos e o mais queridinho recém lançado o Horário VIP (além da escolaridade, os alunos aprimoram o aprendizado, realizam atividades esportivas, trocam idéias com professores e alunos de contra-turno).', 1, '2018-09-23 00:59:58', '2018-09-23 01:09:37', NULL, 0, NULL, NULL, NULL, 28, 'Realizar a inscrição no site Bolsa Livre.\r\nEfetuar o pagamento da taxa de inscrição ao site.\r\nImprimir o CPM - Comprovante de Pré Matrícula liberado pelo site após compensação.\r\nEntregar o CPM na secretaria da instituição selecionada dentro do prazo de 7 dias.\r\nO benefício é válido exclusivamente para as mensalidades.\r\nO benefício é valido exclusivamente para novos alunos.\r\nNecessário ler o regulamento do Bolsa Livre, estar de acordo para concluir a inscrição, bem com o regimento específico.\r\nNecessário assinar o contrato de prestação de serviço educacional na instituição de ensino.\r\nCancelamento da bolsa ocorre quando houver inadimplência, reprovação do aluno pedagógica ou disciplinar.\r\nPode implicar na perda da bolsa de estudos: transferência de unidade, transferência de turno, abandono escolar.', 'O CFV com projetos pedagógicos interativos que estimulam o aprendizado, proporciona o saber ainda mais interessante. Avaliações são realizadas semanalmente. O bom desempenho é cobrado, entretanto o colégio oferece monitorias (tira dúvidas) para reforçar os estudos.', 'Freguesia', '["80","81","86","87"]'),
