(65, 'Centro Cultural Pedro II - Recreio', 'centro-cultural-pedro-ii-recreio', NULL, '01.353.925/0001-89', 'Avenida Jarbas De Carvalho, 288', '22795-440', '(021) 2148-8803', NULL, 134, 'Sempre é desenvolvido a interação, a aprendizagem através dos conteúdos do plano de ensino, as vivências, as experiências, as trocas de informações e a reflexão. Através dos debates entre alunos e professores o conhecimento é construído . Na fase de escolarização é enfatizada a importância da formação de valores, a solidariedade e o respeito ao próximo.', 1, '2018-09-25 21:19:28', '2018-10-11 17:17:52', NULL, 0, NULL, NULL, NULL, 26, 'Realizar a inscrição no site Bolsa Livre.\r\nEfetuar o pagamento da taxa de inscrição ao site.\r\nImprimir o CPM - Comprovante de Pré Matrícula liberado pelo site após compensação.\r\nEntregar o CPM na secretaria da instituição selecionada dentro do prazo de 7 dias.\r\nO benefício é válido exclusivamente para as mensalidades.\r\nO benefício é valido exclusivamente para novos alunos.\r\nNecessário ler o regulamento do Bolsa Livre e estar de acordo para concluir a inscrição.\r\nNecessário assinar o contrato de prestação de serviço educacional na instituição de ensino.\r\nCancelamento da bolsa ocorre quando houver inadimplência, reprovação do aluno pedagógica ou disciplinar.\r\nPode implicar na perda da bolsa de estudos: transferência de unidade, transferência de turno, abandono escolar.', 'A primeira unidade do grupo CCPII, foi fundada em 1983 por seus idealizadores. A meta sempre foi transformar as crianças. Quando as crianças se realizam, são bem sucedidas e felizes em suas vidas, enaltecem o nosso lema: “É sempre possível ser alguém!”.', 'Recreio', '["130"]');
