(83, 'Centro Educacional Salles Freitas', 'centro-educacional-salles-freitas', NULL, '00.318.793/0001-91', 'Rua Biarritz, 14', '21870-190', '(021) 3332-7669', NULL, 98, 'O Sistema de Ensino é Pitágoras, os alunos tem educação tradicional, mas aliada a tecnologia, que envolve a garotada a aprender mais. Aulas com tabletes fornecidos pela escola, aulas de dança (jazz) e jiu jitsu, eventos culturais como Olimpíadas Escolares, aula de música. As todas as salas com ar condicionado, eles também tem aulas de informática, inglês e o seguro escolar obrigatório incluso.', 0, '2018-10-11 19:00:13', '2018-10-11 19:05:27', NULL, 0, NULL, NULL, NULL, 41, 'Realizar a inscrição no site Bolsa Livre.\r\nEfetuar o pagamento da taxa de inscrição ao site.\r\nImprimir o CPM - Comprovante de Pré Matrícula liberado pelo site após compensação.\r\nEntregar o CPM na secretaria da instituição selecionada dentro do prazo de 7 dias.\r\nO benefício é válido exclusivamente para as mensalidades.\r\nO benefício é valido exclusivamente para novos alunos.\r\nNecessário ler o regulamento do Bolsa Livre e estar de acordo para concluir a inscrição.\r\nNecessário assinar o contrato de prestação de serviço educacional na instituição de ensino.\r\nCancelamento da bolsa ocorre quando houver inadimplência, reprovação do aluno pedagógica ou disciplinar.\r\nPode implicar na perda da bolsa de estudos: transferência de unidade, transferência de turno, abandono escolar.', 'Há 23 anos o Salles Freitas forma alunos em Bangu, sendo reconhecida na região por seus diferenciais de alta qualidade. E foi transformando uma comunidade, com seriedade e competência, que famílias foram conquistadas e assim satisfeitas, os ex alunos também formam seus filhos aqui.', 'Bangu', '["96","97","100"]'),
