(88, 'Centro Educacional Gênios Mirins', 'centro-educacional-genios-mirins', NULL, '04.198.234/0001-46', 'Rua Otacílio Nunes, 109', '20750-020', '(021) 2583-5557', NULL, 60, 'A escola garante a formação científica, social, linguística e artística dos alunos. A educação no Gênios é baseada nos princípios éticos individuais e coletivos e a desenvolver suas potencialidades para formar sujeitos inteligentes e atuantes, conscientes dos avanços da tecnologia, da riqueza da cultura, da problemática socioeconômica. Mais sobre a escola: salas amplas e arejadas, parquinho para socialização e relaxamento, sala de vídeo (valorizando a cultura), quadra esportiva, biblioteca, brinquedoteca (para o melhor desenvolvimento cognitivo e social), e para segurança de todos o monitoramento por câmeras em todo o espaço.', 0, '2018-10-12 01:19:10', '2018-10-12 01:22:29', NULL, 0, NULL, NULL, NULL, 50, 'Realizar a inscrição no site Bolsa Livre.\r\nEfetuar o pagamento da taxa de inscrição ao site.\r\nImprimir o CPM - Comprovante de Pré Matrícula liberado pelo site após compensação.\r\nEntregar o CPM na secretaria da instituição selecionada dentro do prazo de 7 dias.\r\nO benefício é válido exclusivamente para as mensalidades.\r\nO benefício é valido exclusivamente para novos alunos.\r\nNecessário ler o regulamento do Bolsa Livre e estar de acordo para concluir a inscrição.\r\nNecessário assinar o contrato de prestação de serviço educacional na instituição de ensino.\r\nCancelamento da bolsa ocorre quando houver inadimplência, reprovação do aluno pedagógica ou disciplinar.\r\nPode implicar na perda da bolsa de estudos: transferência de unidade, transferência de turno, abandono escolar.', 'No Gênios Mirins, desde a sua fundação o trabalho realizado reflete as tradições cristãs e as mudanças da sociedade.', 'Pilares', '["58","59","71"]'),
