(90, 'CEJA - Centro de Ensino de Jacarepaguá', 'ceja-centro-de-ensino-de-jacarepagua', NULL, '01.521.622/0001-28', 'Avenida Geremário Dantas, 373', '22735-000', '(021) 3392-1560', NULL, 88, 'Favorecer o desenvolvimento global da criança, estabelecer e ampliar cada vez mais as relações sociais, de maneira a desenvolver valores e competências necessárias à integração de seu projeto individual ao projeto da sociedade em que se situa. Aprimorar o educando como pessoa humana, incluindo a formação ética e o desenvolvimento da autonomia intelectual e do pensamento crítico. Preparar e orientar para a sua integração ao mundo do trabalho, com as competências que garantam seu aprimoramento profissional e desenvolver as competências para continuar aprendendo, de forma autônoma e crítica, em níveis mais complexos de estudos.', 0, '2018-10-15 18:35:16', '2018-10-15 22:16:55', NULL, 0, NULL, NULL, NULL, 52, 'Realizar a inscrição no site Bolsa Livre.\r\nEfetuar o pagamento da taxa de inscrição ao site.\r\nImprimir o CPM - Comprovante de Pré Matrícula liberado pelo site após compensação.\r\nEntregar o CPM na secretaria da instituição selecionada dentro do prazo de 7 dias.\r\nO benefício é válido exclusivamente para as mensalidades.\r\nO benefício é valido exclusivamente para novos alunos.\r\nNecessário ler o regulamento do Bolsa Livre e estar de acordo para concluir a inscrição.\r\nNecessário assinar o contrato de prestação de serviço educacional na instituição de ensino.\r\nCancelamento da bolsa ocorre quando houver inadimplência, reprovação do aluno pedagógica ou disciplinar.\r\nPode implicar na perda da bolsa de estudos: transferência de unidade, transferência de turno, abandono escolar.', 'Projeto Pedagógico CEJA “Cidadania, Participação e Inclusão: uma responsabilidade de todos” valorizando o processo de democratização do ensino. O bom ensino deve ser permeado de múltiplas formas de interação e afetividade entre todos os atores no processo ensino-aprendizagem.', 'Tanque', '["80","84","85","86","87"]'),
(91, 'CEJA - Centro de Ensino de Jacarepaguá', 'ceja-centro-de-ensino-de-jacarepagua-1', NULL, '01.521.622/0001-28', 'Avenida Geremário Dantas, 373', '22735-000', '(021) 3392-1560', NULL, 88, 'Favorecer o desenvolvimento global da criança, estabelecer e ampliar cada vez mais as relações sociais, de maneira a desenvolver valores e competências necessárias à integração de seu projeto individual ao projeto da sociedade em que se situa. Aprimorar o educando como pessoa humana, incluindo a formação ética e o desenvolvimento da autonomia intelectual e do pensamento crítico. Preparar e orientar para a sua integração ao mundo do trabalho, com as competências que garantam seu aprimoramento profissional e desenvolver as competências para continuar aprendendo, de forma autônoma e crítica, em níveis mais complexos de estudos.', 0, '2018-10-15 20:03:47', '2018-10-15 22:16:47', NULL, 0, NULL, NULL, NULL, 52, 'Realizar a inscrição no site Bolsa Livre.\r\nEfetuar o pagamento da taxa de inscrição ao site.\r\nImprimir o CPM - Comprovante de Pré Matrícula liberado pelo site após compensação.\r\nEntregar o CPM na secretaria da instituição selecionada dentro do prazo de 7 dias.\r\nO benefício é válido exclusivamente para as mensalidades.\r\nO benefício é valido exclusivamente para novos alunos.\r\nNecessário ler o regulamento do Bolsa Livre e estar de acordo para concluir a inscrição.\r\nNecessário assinar o contrato de prestação de serviço educacional na instituição de ensino.\r\nCancelamento da bolsa ocorre quando houver inadimplência, reprovação do aluno pedagógica ou disciplinar.\r\nPode implicar na perda da bolsa de estudos: transferência de unidade, transferência de turno, abandono escolar.', 'Projeto Pedagógico CEJA “Cidadania, Participação e Inclusão: uma responsabilidade de todos” valorizando o processo de democratização do ensino. O bom ensino deve ser permeado de múltiplas formas de interação e afetividade entre todos os atores no processo ensino-aprendizagem.', 'Tanque', '["52","72","78","80","84","85","86","87","89","130","134"]'),
(92, 'CEPRAMED', 'cepramed', NULL, '25.278.266/0001-21', 'Rua Dagmar da Fonseca, 89', '21351-040', '(021) 3129-2004', NULL, 72, 'Técnico em Radiologia - Setores de atuação do profissional:\r\nHospitais, clínicas hospitalares, clínicas odontológicas, laboratórios de diagnóstico por imagem, ambulatórios, centros de pesquisa, industrias de pequeno e grande porte.\r\n\r\nTécnico em Enfermagem - Setores de atuação do profissional:\r\nHospitais, clínicas, laboratórios, ambulatórios, resgates, home care, instituições de ensino, instituições empresariais corporativas e industriais, casas de repouso, prestar concurso público e ainda departamentos de qualidade, auditorias…', 0, '2018-10-15 22:28:03', '2018-11-19 21:53:38', NULL, 0, NULL, NULL, NULL, 64, 'Realizar a inscrição no site Bolsa Livre.\r\nEfetuar o pagamento da taxa de inscrição ao site.\r\nImprimir o CPM - Comprovante de Pré Matrícula liberado pelo site após compensação.\r\nEntregar o CPM na secretaria da instituição selecionada dentro do prazo de 7 dias.\r\nO benefício é válido exclusivamente para as mensalidades.\r\nO benefício é valido exclusivamente para novos alunos.\r\nNecessário ler o regulamento do Bolsa Livre e estar de acordo para concluir a inscrição.\r\nNecessário assinar o contrato de prestação de serviço educacional na instituição de ensino.\r\nCancelamento da bolsa ocorre quando houver inadimplência, reprovação do aluno pedagógica ou disciplinar.\r\nPode implicar na perda da bolsa de estudos: transferência de unidade, transferência de turno, abandono escolar.', 'O CEPRAMED é parceiro do maior Centro de Simulação realística da América Latina! Os alunos realizam estágios com padrões internacionais com simulações realísticas e chancelados pela American Heart Association!', 'Madureira', '["52","55","65","71","78","80"]'),
(93, 'Centro Educacional Henry Dunant', 'centro-educacional-henry-dunant', NULL, '11.511.918/0001-11', 'Rua Hermengarda, 90', '20710-010', '(021) 3042-4903', NULL, 52, 'Técnico em Análises Clínicas - Setores de atuação do profissional:\r\nEmpresas privadas, prestar concursos públicos, como atuar em hospitais, clínicas, postos de saúde, laboratórios, diversas industrias, controladorias de qualidade e auditorias.\r\n\r\nTécnico em Radiologia - Setores de atuação do profissional:\r\nHospitais, clínicas hospitalares, clínicas odontológicas, laboratórios de diagnóstico por imagem, ambulatórios, centros de pesquisa, industrias de pequeno e grande porte.', 0, '2018-10-15 22:52:25', '2018-11-19 21:48:27', NULL, 0, NULL, NULL, NULL, 63, 'Realizar a inscrição no site Bolsa Livre.\r\nEfetuar o pagamento da taxa de inscrição ao site.\r\nImprimir o CPM - Comprovante de Pré Matrícula liberado pelo site após compensação.\r\nEntregar o CPM na secretaria da instituição selecionada dentro do prazo de 7 dias.\r\nO benefício é válido exclusivamente para as mensalidades.\r\nO benefício é valido exclusivamente para novos alunos.\r\nNecessário ler o regulamento do Bolsa Livre e estar de acordo para concluir a inscrição.\r\nNecessário assinar o contrato de prestação de serviço educacional na instituição de ensino.\r\nCancelamento da bolsa ocorre quando houver inadimplência, reprovação do aluno pedagógica ou disciplinar.\r\nPode implicar na perda da bolsa de estudos: transferência de unidade, transferência de turno, abandono escolar.', 'No Henry os alunos encaminhados para o estágio obrigatório sem custo adicional. Laboratórios modernos e equipados altamente tecnológicos. Estrutura de qualidade para proporcionar o melhor aprendizado de seus alunos, como salas climatizadas e multimídia.', 'Méier', '["37","51","55","72","96","98"]'),
(94, 'CETB - Centro Técnico Bonsucesso', 'cetb-centro-tecnico-bonsucesso', NULL, '05.076.689/0001-51', 'Rua Dona Isabel, 794', '21032-060', '(021) 3976-3522', NULL, 37, 'Técnico em Radiologia - Setores de atuação do profissional:\r\nHospitais, clínicas hospitalares, clínicas odontológicas, laboratórios de diagnóstico por imagem, ambulatórios, centros de pesquisa, industrias de pequeno e grande porte.\r\n\r\nCuidador de Auxiliar de Saúde Bucal - Setores de atuação do profissional:\r\nClínicas, consultórios. Se pretende atuar em hospitais em centros cirúrgicos, é preciso complementar o curso com Instrumentação Cirúrgica.\r\n\r\nCuidador de Idosos - Setores de atuação do profissional:\r\nHome care, casas de repouso, acompanhante particular...', 0, '2018-10-15 23:05:44', '2018-11-19 21:46:49', NULL, 0, NULL, NULL, NULL, 62, 'Realizar a inscrição no site Bolsa Livre.\r\nEfetuar o pagamento da taxa de inscrição ao site.\r\nImprimir o CPM - Comprovante de Pré Matrícula liberado pelo site após compensação.\r\nEntregar o CPM na secretaria da instituição selecionada dentro do prazo de 7 dias.\r\nO benefício é válido exclusivamente para as mensalidades.\r\nO benefício é valido exclusivamente para novos alunos.\r\nNecessário ler o regulamento do Bolsa Livre e estar de acordo para concluir a inscrição.\r\nNecessário assinar o contrato de prestação de serviço educacional na instituição de ensino.\r\nCancelamento da bolsa ocorre quando houver inadimplência, reprovação do aluno pedagógica ou disciplinar.\r\nPode implicar na perda da bolsa de estudos: transferência de unidade, transferência de turno, abandono escolar.', 'O CETB nasceu no ano de 2002. O curso tem como objetivo de qualificar e formar Técnicos em Áreas de Saúde, proporcionando um vasto conhecimento nas profissões aqui escolhidas.', 'Bonsucesso', '["1","38","39","40","63","65","162"]'),
(95, 'Colégio Campos Sales', 'colegio-campos-sales', NULL, '27.057.538/0001-99', 'Rua Ponta Grossa, 210', '23015-225', '(021) 2416-1350', NULL, 101, 'Educar é semear com sabedoria e paciência.', 0, '2018-10-15 23:19:57', '2018-11-19 21:45:31', NULL, 0, NULL, NULL, NULL, 60, 'Realizar a inscrição no site Bolsa Livre.\r\nEfetuar o pagamento da taxa de inscrição ao site.\r\nImprimir o CPM - Comprovante de Pré Matrícula liberado pelo site após compensação.\r\nEntregar o CPM na secretaria da instituição selecionada dentro do prazo de 7 dias.\r\nO benefício é válido exclusivamente para as mensalidades.\r\nO benefício é valido exclusivamente para novos alunos.\r\nNecessário ler o regulamento do Bolsa Livre e estar de acordo para concluir a inscrição.\r\nNecessário assinar o contrato de prestação de serviço educacional na instituição de ensino.\r\nCancelamento da bolsa ocorre quando houver inadimplência, reprovação do aluno pedagógica ou disciplinar.\r\nPode implicar na perda da bolsa de estudos: transferência de unidade, transferência de turno, abandono escolar.', 'No Colégio Campos Sales, os alunos desenvolvem a criatividade, suas emoções são ativadas e educadas, expandindo a capacidade de aprendizado e raciocínio.', 'Campo Grande', 'null');
INSERT INTO `institutions` (`id`, `name`, `slug`, `image`, `cnpj`, `address`, `cep`, `phone`, `thumbnail`, `neighborhood_id`, `description`, `destaque_home`, `created_at`, `updated_at`, `deleted_at`, `total_read`, `created_by`, `updated_by`, `deleted_by`, `user_id`, `rules`, `excerpt`, `unidade`, `bairros_vizinhos`) VALUES
(96, 'Colégio João Lyra Filho', 'colegio-joao-lyra-filho', NULL, '33.777.848/0001-80', 'Avenida Dom Hélder Câmara, 9503', '21380-008', '(021) 3217-9320', NULL, 68, 'Tem por objetivo desenvolver a independência do aluno. Compreender o meio ambiente. Fortalecer a autoestima. Brincar, proporcionando a transformação do conhecimento da criança. Através de experiências resultantes de atividades oferecidas à criança, com o objetivo de promover o seu desenvolvimento e sua integração social.', 0, '2018-10-15 23:44:25', '2018-11-19 21:45:18', NULL, 0, NULL, NULL, NULL, 61, 'Realizar a inscrição no site Bolsa Livre.\r\nEfetuar o pagamento da taxa de inscrição ao site.\r\nImprimir o CPM - Comprovante de Pré Matrícula liberado pelo site após compensação.\r\nEntregar o CPM na secretaria da instituição selecionada dentro do prazo de 7 dias.\r\nO benefício é válido exclusivamente para as mensalidades.\r\nO benefício é valido exclusivamente para novos alunos.\r\nNecessário ler o regulamento do Bolsa Livre e estar de acordo para concluir a inscrição.\r\nNecessário assinar o contrato de prestação de serviço educacional na instituição de ensino.\r\nCancelamento da bolsa ocorre quando houver inadimplência, reprovação do aluno pedagógica ou disciplinar.\r\nPode implicar na perda da bolsa de estudos: transferência de unidade, transferência de turno, abandono escolar.', 'Há 50 anos o João Lyra oferece oportunidade de ensino particular de qualidade à população da área onde atua, tornando-se a escola mais tradicional do bairro.', 'Quintino', '["58","60","67","71","72","148","149"]'),
(97, 'Colégio Peri', 'colegio-peri', NULL, '42.311.407/0001-80', 'Estrada do Tingui, 570', '23075-007', '(021) 3402-5096', NULL, 101, 'É uma escola tradicional por essência, e implantou atividades que envolvem os alunos à condicionar disciplina, responsabilidade, respeito ao próximo, independência e a compreensão da interdependência de uma sociedade: NATAÇÃO, KARATÊ, INGLÊS, BALLET, HIP-HOP, INFORMÁTICA. Conta também com uma super estrutura.', 0, '2018-10-16 00:05:00', '2018-11-19 21:45:05', NULL, 0, NULL, NULL, NULL, 59, 'Realizar a inscrição no site Bolsa Livre.\r\nEfetuar o pagamento da taxa de inscrição ao site.\r\nImprimir o CPM - Comprovante de Pré Matrícula liberado pelo site após compensação.\r\nEntregar o CPM na secretaria da instituição selecionada dentro do prazo de 7 dias.\r\nO benefício é válido exclusivamente para as mensalidades.\r\nO benefício é valido exclusivamente para novos alunos.\r\nNecessário ler o regulamento do Bolsa Livre e estar de acordo para concluir a inscrição.\r\nNecessário assinar o contrato de prestação de serviço educacional na instituição de ensino.\r\nCancelamento da bolsa ocorre quando houver inadimplência, reprovação do aluno pedagógica ou disciplinar.\r\nPode implicar na perda da bolsa de estudos: transferência de unidade, transferência de turno, abandono escolar.', 'O Colégio Peri foi fundando em 1951, até os dias de hoje é uma instituição admirada e procurada por pais formados em outras gerações, que fazem questão de formar seus filhos no Peri.', 'Campo Grande', 'null'),
(98, 'Colégio CEDRO', 'colegio-cedro', NULL, '05.337.469/0001-34', 'Estrada do Capenha, 937', '22743-041', '(21) 2424-6748', NULL, 86, 'As crianças aprendem e se divertem aprendendo, com aulas de Música, Artes, Informática, Educação psicomotora, Natação, Culinária, Inglês, Educação financeira, Ballet ou Jazz (opcional) Judô (opcional).', 1, '2018-11-21 01:20:37', '2018-11-21 01:20:37', NULL, 0, NULL, NULL, NULL, 65, 'Realizar a inscrição no site Bolsa Livre.\r\nEfetuar o pagamento da taxa de inscrição ao site.\r\nImprimir o CPM - Comprovante de Pré Matrícula liberado pelo site após compensação.\r\nEntregar o CPM na secretaria da instituição selecionada dentro do prazo de 7 dias.\r\nO benefício é válido exclusivamente para as mensalidades.\r\nO benefício é valido exclusivamente para novos alunos.\r\nNecessário ler o regulamento do Bolsa Livre e estar de acordo para concluir a inscrição.\r\nNecessário assinar o contrato de prestação de serviço educacional na instituição de ensino.\r\nCancelamento da bolsa ocorre quando houver inadimplência, reprovação do aluno pedagógica ou disciplinar.\r\nPode implicar na perda da bolsa de estudos: transferência de unidade, transferência de turno, abandono escolar.', 'A segunda casa de cada aluno é no CEDRO, aqui as turmas são reduzidas e cada aluno é reconhecido pelo nome.', 'Pechincha', '["80","85"]'),
(99, 'Centro Educacional Castro Barreto', 'centro-educacional-castro-barreto', NULL, '72101017/0001-46', 'Estrada da Cachamorra, 719', '21555-300', '(21) 3689-7518', NULL, 101, 'Escopo pedagógico bem estruturado, para a melhor compreensão e fixação do aprendizado do aluno. A escola dispõe de atividades e estruturas especiais, como: Artes, Laboratório de Ciência, Computação, Expressão Corporal, Salas de Leitura, Esportes, Área Verde e Idiomas.', 1, '2018-11-21 01:34:02', '2018-11-21 01:34:02', NULL, 0, NULL, NULL, NULL, 67, 'Realizar a inscrição no site Bolsa Livre.\r\nEfetuar o pagamento da taxa de inscrição ao site.\r\nImprimir o CPM - Comprovante de Pré Matrícula liberado pelo site após compensação.\r\nEntregar o CPM na secretaria da instituição selecionada dentro do prazo de 7 dias.\r\nO benefício é válido exclusivamente para as mensalidades.\r\nO benefício é valido exclusivamente para novos alunos.\r\nNecessário ler o regulamento do Bolsa Livre e estar de acordo para concluir a inscrição.\r\nNecessário assinar o contrato de prestação de serviço educacional na instituição de ensino.\r\nCancelamento da bolsa ocorre quando houver inadimplência, reprovação do aluno pedagógica ou disciplinar.\r\nPode implicar na perda da bolsa de estudos: transferência de unidade, transferência de turno, abandono escolar.', 'No Castro Barreto a educação é baseada em princípios democráticos, na Pedagogia Progressista Libertadora (Paulo Freire), com direitos de participação iguais pra estudantes, professores e funcionários, sendo os nossos alunos atores centrais do processo de aprendizagem.', 'Campo Grande', '["100"]'),
(100, 'Creche Escola Aquarela do Recreio', 'creche-escola-aquarela-do-recreio', NULL, '07.190.940/0001-30', 'Rua General Landry Gonçalves, 142', '22795-410', '(21) 2437-0448', NULL, 134, 'O professor media este conhecimento com projetos didáticos como apoio para a apresentação e desenvolvimento de conteúdos, estimulando a criatividade, a reflexão e o interesse pelos temas que permeiam nossa sociedade.\r\nDe maneira lúdica e prazerosa,  o conhecimento é compartilhado por todos os envolvidos. As crianças ensinam enquanto aprendem e o professor também aprende enquanto ensina. A equipe pedagógica é composta por profissionais de diferentes áreas: pedagogas, psicopedagoga, psicomotricista, fonoaudióloga, nutricionista e técnica de enfermagem. Esses profissionais acompanham de forma individualizada os alunos e as famílias\r\n\r\nAcrescente as atividades a seguir no dia-a-dia do seu maior bem, são 2x na semana: Judo, Ballet, Capoeira, Dança – por mais R$ 150,00.\r\nSeu filho vai aprender, vai brincar, vai poder desenvolver ainda melhor suas relações sociais e práticas físicas. Solicite em nosso atendimento.', 1, '2018-11-21 01:38:31', '2018-11-21 01:47:17', NULL, 0, NULL, NULL, NULL, 66, 'Realizar a inscrição no site Bolsa Livre.\r\nEfetuar o pagamento da taxa de inscrição ao site.\r\nImprimir o CPM - Comprovante de Pré Matrícula liberado pelo site após compensação.\r\nEntregar o CPM na secretaria da instituição selecionada dentro do prazo de 7 dias.\r\nO benefício é válido exclusivamente para as mensalidades.\r\nO benefício é valido exclusivamente para novos alunos.\r\nNecessário ler o regulamento do Bolsa Livre e estar de acordo para concluir a inscrição.\r\nNecessário assinar o contrato de prestação de serviço educacional na instituição de ensino.\r\nCancelamento da bolsa ocorre quando houver inadimplência, reprovação do aluno pedagógica ou disciplinar.\r\nPode implicar na perda da bolsa de estudos: transferência de unidade, transferência de turno, abandono escolar.', 'A proposta fundamenta-se nas ideias socio-interacionistas de Lev Vygotsky, no qual ele compreende o homem como um ser que se forma em contato com a sociedade.', 'Recreio', '["132","133"]'),
(101, 'Centro de Educação Integral Aquarela', 'centro-de-educacao-integral-aquarela', NULL, '0000000000000', 'Rua Hermelindo Teixeira Loyola, 265', '23075-645', '(21) 3284-8563', NULL, 101, 'O conhecimento não está pronto, portanto, deve ser construído. Aqui a criança é estimulada a agir, operar, criar, construir a partir da realidade vivida por alunos e professores, isto é, pela sociedade – a próxima e, aos poucos, as distantes.  Dentro desta filosofia de ensino, o método Construtivismo é utilizado.', 1, '2018-11-21 01:54:22', '2018-11-21 01:54:22', NULL, 0, NULL, NULL, NULL, 68, 'Realizar a inscrição no site Bolsa Livre.\r\nEfetuar o pagamento da taxa de inscrição ao site.\r\nImprimir o CPM - Comprovante de Pré Matrícula liberado pelo site após compensação.\r\nEntregar o CPM na secretaria da instituição selecionada dentro do prazo de 7 dias.\r\nO benefício é válido exclusivamente para as mensalidades.\r\nO benefício é valido exclusivamente para novos alunos.\r\nNecessário ler o regulamento do Bolsa Livre e estar de acordo para concluir a inscrição.\r\nNecessário assinar o contrato de prestação de serviço educacional na instituição de ensino.\r\nCancelamento da bolsa ocorre quando houver inadimplência, reprovação do aluno pedagógica ou disciplinar.\r\nPode implicar na perda da bolsa de estudos: transferência de unidade, transferência de turno, abandono escolar.', 'O Aquarela Campo Grande atua através dos seguintes valores: Cuidado, Desenvolvimento Integral, Afeto, Inovação, Inclusão e Criatividade.', 'Campo Grande', '["103"]'),
(102, 'Colégio e Curso GMT', 'colegio-e-curso-gmt', NULL, '05.630.548/0001-39', 'Rua Pedro de Carvalho, 97', '20725-230', '(21) 3979-2728', NULL, 52, 'Aqui o aluno é estimulado a aprender. Ele aprende que aprender interessante. Teste vocacional, assessoria pedagógica, acompanhamento acadêmico virtual. Feira cultural onde os alunos aprendem desde a organização, montagem, execução de atividades, Vernissage, sarau cultural. Aulas de campo com passeios guiados. Simulados ENEM de alta performance.  \r\nTodas as salas climatizadas, equipadas com recursos multimídias possibilitando maior interação dos alunos, professores por meios tecnológicos que super agradam os jovens.', 1, '2018-11-22 01:28:26', '2018-11-22 01:28:26', NULL, 0, NULL, NULL, NULL, 69, 'Realizar a inscrição no site Bolsa Livre.\r\nEfetuar o pagamento da taxa de inscrição ao site.\r\nImprimir o CPM - Comprovante de Pré Matrícula liberado pelo site após compensação.\r\nEntregar o CPM na secretaria da instituição selecionada dentro do prazo de 7 dias.\r\nO benefício é válido exclusivamente para as mensalidades.\r\nO benefício é valido exclusivamente para novos alunos.\r\nNecessário ler o regulamento do Bolsa Livre e estar de acordo para concluir a inscrição.\r\nNecessário assinar o contrato de prestação de serviço educacional na instituição de ensino.\r\nCancelamento da bolsa ocorre quando houver inadimplência, reprovação do aluno pedagógica ou disciplinar.\r\nPode implicar na perda da bolsa de estudos: transferência de unidade, transferência de turno, abandono escolar.', 'GMT desde 2003 atua formando alunos do Fundamental II ao Ensino Médio. O Sistema é o PEC de ensino.', 'Méier', '["50","54","55","56"]');
